import styled from "styled-components";
export const FiltersWrapper = styled.ul`
	width: 80%;
	display: flex;
	flex-flow: row nowrap;
	background-color: inherit;
	justify-content: space-around;
	color: #284b63;
	list-style-type: none;
`;
